// admindashboard.jsx
import React, { useState } from 'react';
import AdminBiciestacionamientos from './adminbiciestacionamientos';
import AdminUsuarios from './adminusuarios';
import AdminPropuestas from './adminpropuestas'; // üëà IMPORTAR
import './admindashboard.css';

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState('biciestacionamientos');

  return (
    <div className="admin-dashboard">
      <div className="admin-header">
        <h1>Panel de Administraci√≥n</h1>
      </div>

      <div className="admin-tabs">
        <button 
          className={activeTab === 'biciestacionamientos' ? 'tab-active' : ''}
          onClick={() => setActiveTab('biciestacionamientos')}
        >
          Biciestacionamientos
        </button>
        <button 
          className={activeTab === 'propuestas' ? 'tab-active' : ''}
          onClick={() => setActiveTab('propuestas')}
        >
          Propuestas
        </button>
        <button 
          className={activeTab === 'usuarios' ? 'tab-active' : ''}
          onClick={() => setActiveTab('usuarios')}
        >
          Usuarios
        </button>
      </div>

      <div className="admin-content">
        {activeTab === 'biciestacionamientos' && <AdminBiciestacionamientos />}
        {activeTab === 'propuestas' && <AdminPropuestas />}
        {activeTab === 'usuarios' && <AdminUsuarios />}
      </div>
    </div>
  );
};

export default AdminDashboard;
